import React from "react";
import { Link } from "react-router-dom";
// Style
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

export const LogoLink = () => {
  return (
    <Box sx={{ pl: 2 }}>
      <Button
        component={Link}
        sx={{ letterSpacing: 4 }}
        to={`/`}
      >
        <b>睡眠補完計画</b>
      </Button>
    </Box>
  )
}
